window.bookSummaryJSON = "<p><b>There were a lot of things that I could live without.</b></p> <p>I had lived without freedom for the past fifteen years. My wife was someone that I couldn't live without, and I needed her. Alaia saved a lot of people with just a touch of her hand on my arm. She calmed the beast within me, reminded me what I had at home.</p> <p>Alaia was someone that I refused to live without, and now, they took her from me. They touched my wife and thought they would be able to live to talk about it. You didn't touch a Delgato and thought you would live. You didn't touch what was mine and think you could live.</p> <p>Joy already knew how her Roy was coming behind her—always.</p>"; 
